import { Link } from "react-router-dom";

export default function Navbar() {
  return (
    <nav className="bg-white shadow p-4 flex justify-between items-center">
      <Link to="/" className="text-blue-600 font-bold text-lg">Alkarama Hub</Link>
      <div className="space-x-4">
        <Link to="/" className="text-sm text-gray-700 hover:text-blue-500">Home</Link>
        <Link to="/about" className="text-sm text-gray-700 hover:text-blue-500">About</Link>
      </div>
    </nav>
  );
}
